@EBean
class NumberLinkDocument : GameDocument<NumberLinkGame, NumberLinkGameMove>() {
    protected override fun saveMove(move: NumberLinkGameMove, rec: MoveProgress) {
        rec.row = move.p.row
        rec.col = move.p.col
        rec.intValue1 = move.dir
    }

    override fun loadMove(rec: MoveProgress): NumberLinkGameMove {
        return object : NumberLinkGameMove() {
            init {
                p = Position(rec.row, rec.col)
                dir = rec.intValue1
            }
        }
    }
}